description:
The film tells the story of a poor fisherman, who, in a dream, is instructed by San Gennaro to play the lottery. After loosing all his savings, in order to pay back the loan taken from a tightfisted usurian, he has no other choice, but to ask his wife to offer up her body as payment and face the humiliating consequences, which eventually lead to her suicide. This movie has been acknowledged as Selen's finest performance ever! and by many never reached again, sadly.

